// CHALLENGE: uncomment the code below and see the car stats rendered
import React from "react";
import ReactDOM from "react-dom";

import practice from './practice';

let [model, colorsByPopularity, speedStats] = cars;
let tesla = cars.model("Tesla Model 3");
console.log(tesla);
let honda = cars.model("Honda Civic");
let teslaTopSpeed = tesla.speedStats;
let hondaTopSpeed = honda.speedStats;
let teslaTopColour = tesla.colorsByPopularity;
let hondaTopColour = honda.colorsByPopularity;

ReactDOM.render(
  <table>
    <tr>
      <th>Brand</th>
      <th>{speedStats.topSpeed}</th>
    </tr>
    <tr>
      <td>{tesla.model}</td>
      <td>{teslaTopSpeed}</td>
      <td>{teslaTopColour}</td>
    </tr>
    <tr>
      <td>{honda.model}</td>
      <td>{hondaTopSpeed}</td>
      <td>{hondaTopColour}</td>
    </tr>
  </table>,
  document.getElementById("root")
);
